"""Next, let's create markers for all launch records. If a launch was successful (class=1), then we use a green marker and if a launch was failed, we use a red marker (class=0)

Note that a launch only happens in one of the four launch sites, which means many launch records will have the exact same coordinate. Marker clusters can be a good way to simplify a map containing many markers having the same coordinate.

Let's first create a MarkerCluster object
"""

marker_cluster = MarkerCluster()

"""TODO: Create a new column in launch_sites dataframe called marker_color to store the marker colors based on the class value"""

# Apply a function to check the value of `class` column
# If class=1, marker_color value will be green
# If class=0, marker_color value will be red

marker_color = []
def assign_marker_colors():
    for i in spacex_df['class']:
        if i == 1:
            marker_color.append('Green')
        else:
            marker_color.append('Red')

# Apply the function to populate the marker_colors list
assign_marker_colors()
spacex_df['marker_color']= marker_color
spacex_df.tail(10)

"""TODO: For each launch result in spacex_df data frame, add a folium.Marker to marker_cluster"""

# Add marker_cluster to current site_map
site_map.add_child(marker_cluster)

# for each row in spacex_df data frame
# create a Marker object with its coordinate
# and customize the Marker's icon property to indicate if this launch was successed or failed,
# e.g., icon=folium.Icon(color='white', icon_color=row['marker_color']
for index, record in spacex_df.iterrows():
    # TODO: Create and add a Marker cluster to the site map
    # marker = folium.Marker(...)
    coordinate = [record['Lat'], record['Long']]
    marker = folium.Marker(coordinate, icon=folium.Icon(color='white', icon_color=record['marker_color']))
    marker_cluster.add_child(marker)

